-- kategoriak

CREATE TABLE `kategoriak` (
  `id` int(11) NOT NULL,
  `nev` varchar(512) COLLATE utf8mb4_hungarian_ci NOT NULL
);

ALTER TABLE `kategoriak`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `kategoriak`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=10;



-- tesztak

CREATE TABLE `tesztak` (
  `id` int(11) NOT NULL,
  `nev` varchar(1024) COLLATE utf8mb4_hungarian_ci NOT NULL,
  `kiszereles` int(11) NOT NULL,
  `ar` int(11) NOT NULL,
  `kategoriaId` int(11) NOT NULL
);

ALTER TABLE `tesztak`
    ADD PRIMARY KEY (`id`),
    ADD KEY `kategoriaId` (`kategoriaId`);

ALTER TABLE `tesztak`
    ADD CONSTRAINT FK_kategoriak_kategoriaId FOREIGN KEY (kategoriaId)
    REFERENCES kategoriak (id);


-- Tábla szerkezet ehhez a táblához `vevok`
--

CREATE TABLE `vevok` (
  `id` int(11) DEFAULT NULL,
  `nev` varchar(1024) COLLATE utf8mb4_hungarian_ci NOT NULL
);

ALTER TABLE `vevok`
  ADD PRIMARY KEY (`id`);



-- rendelesek

CREATE TABLE `rendelesek` (
  `id` int(11) NOT NULL,
  `vevoId` int(11) NOT NULL,
  `datum` date NOT NULL
);

ALTER TABLE `rendelesek`
  ADD PRIMARY KEY (`id`),
  ADD KEY `vevoId` (`vevoId`);

ALTER TABLE `rendelesek`
    ADD CONSTRAINT FK_vevok_vevoId FOREIGN KEY (vevoId)
    REFERENCES vevok (id);



-- rendeleselemek

CREATE TABLE `rendeleselemek` (
  `id` int(11) NOT NULL,
  `rendelesId` int(11) NOT NULL,
  `tesztaId` int(11) NOT NULL,
  `mennyiseg` int(11) NOT NULL,
  `egysegAr` int(11) NOT NULL
);

ALTER TABLE `rendeleselemek`
  ADD PRIMARY KEY (`id`),
  ADD KEY `rendelesId` (`rendelesId`),
  ADD KEY `tesztaId` (`tesztaId`);

ALTER TABLE `rendeleselemek`
    ADD CONSTRAINT FK_rendelesek_rendelesId FOREIGN KEY (rendelesId)
    REFERENCES rendelesek (id);

ALTER TABLE `rendeleselemek`
    ADD CONSTRAINT FK_tesztak_tesztaId FOREIGN KEY (tesztaId)
    REFERENCES tesztak (id);

ALTER TABLE `rendeleselemek`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=36388;

